 constructor(props){
  super(props) 

  this.state = {
    hasSearched : false
  }
 }

  render() {

    console.log(this.state.hasSearched) 

    return (
      <div className="DeepSearch">
       <button className="SearchButton" > 
         <i className="icon-magn_icon"></i> 
